                                <ul>
                                    <li>Get trained through KnowledgeHut, a Certified Partner of AXELOS and an accredited training organization (ATO) with PeopleCert®.&nbsp;</li>
                                    <li>Enrol for an upcoming PRINCE2 Agile® Practitioner course and take the 16-hour training.&nbsp;</li>
