    <section class="curriculum" id="curriculum-1">
        <div class="container-fluid">
            <div class="row">
                <div class="col-xl-8 col-lg-8 col-md-8 col-sm-12 col-sm-70">
                    <div class="main-title">
                        <h2 class="section-heading">PRINCE2 Agile Practitioner Course Curriculum</h2> <a href="javascript:void(0);" class="btn download_curriculum d-none d-sm-block" title="Download" data-toggle="modal" data-target="#download-brochure-modal" data-form-identity-code="CURRICULUM_DOWNLOAD_CURRICULUM" data-form-identity-name="Download curriculum"> <span> <i class="layout-icons icon-download" style="background-image: url(&quot;https://d2o2utebsixu4k.cloudfront.net/assets/icons/icon-sprite.svg&quot;); background-repeat: no-repeat;"></i> </span> </a>
                    </div>
                    <div class="topics">
                        <div class="curriculum-accordion-content" id="curriculum-accordion">
                            <div class="card">
                                <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#collapse1">Introduction</a> <span class="curi-num"> 1. </span> </div>
                                <div id="collapse1" class="card-body collapse " data-parent="#curriculum-accordion">
                                    <div class="topic-summary editor-content">
                                        <p><b>Learning objectives&nbsp;</b></p>
                                        <p>Get an introduction to PRINCE2 Agile Practitioner and understand the basic concepts of common agile ways of working.&nbsp;</p>
                                        <p><b><br></b></p>
                                        <p><b>Topics&nbsp;</b></p>
                                        <ul>
                                            <li>Differences between a project and BAU (Business as usual)&nbsp;&nbsp;</li>
                                            <li>Definition of Agile, its common approaches and uses&nbsp;<br></li>
                                            <li>Agile vs Waterfall and the Agile Manifesto&nbsp;<br></li>
                                            <li>Levels of agile maturity and well-known agile frameworks&nbsp;&nbsp;<br></li>
                                            <li>Behaviours, concepts, and techniques in Agile&nbsp;&nbsp;<br></li>
                                            <li>What is the PRINCE2 Agile view of ‘agile’&nbsp;<br></li>
                                            <li>Kanban, its six general practices, and Cumulative Flow Diagrams (CFDs)&nbsp;<br></li>
                                            <li>Core concepts of a Lean Start-Up&nbsp;&nbsp;<br></li>
                                            <li>How workshops are useful&nbsp;<br></li>
                                            <li>How to transition to agile&nbsp;<br></li>
                                            <li>Scrum theory: team, events, artifacts, and sprints&nbsp;&nbsp;<br></li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                            <div class="card">
                                <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#collapse2">PRINCE2 in Agile Context</a> <span class="curi-num"> 2. </span> </div>
                                <div id="collapse2" class="card-body collapse " data-parent="#curriculum-accordion">
                                    <div class="topic-summary editor-content">
                                        <p><b>Learning objectives&nbsp;</b></p>
                                        <p>Understand the purpose and context for combining PRINCE2 and the agile way of working. Learn what a typical PRINCE2 ‘project journey’ looks like in an agile context.</p>
                                        <p><br></p>
                                        <p><b>Topics&nbsp;</b></p>
                                        <ul>
                                            <li>How PRINCE2 and the agile way of working complement each other&nbsp;</li>
                                            <li>Who can benefit from PRINCE2 Agile and in what contexts/situations&nbsp;</li>
                                            <li>PRINCE2 Agile: Frameworks, behaviours, concepts, techniques and focus areas&nbsp;</li>
                                            <li>The Eight ‘Guidance Points’&nbsp;<br></li>
                                            <li>Enabling agile across environments: PRINCE2 controls and governance&nbsp;<br></li>
                                            <li>A typical PRINCE2 ‘project journey’ in an agile context</li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                            <div class="card">
                                <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#collapse3">Applying Focus Areas to Agile Projects</a> <span class="curi-num"> 3. </span> </div>
                                <div id="collapse3" class="card-body collapse " data-parent="#curriculum-accordion">
                                    <div class="topic-summary editor-content">
                                        <p><b>Learning objectives&nbsp;</b></p>
                                        <p>Learn to apply and evaluate the focus areas to a project in an agile context. Learn about Agilometer, the six sliders used on the Agilometer, MoSCoW, and more.</p>
                                        <p><br></p>
                                        <p><b>Topics</b></p>
                                        <ul>
                                            <li>Agilometer: purpose and use throughout a project&nbsp;</li>
                                            <li>The six sliders of an Agilometer: significance and how to improve them&nbsp;<br></li>
                                            <li>Requirements terminologies: decomposition, prioritization, MoSCoW, Ordering and more&nbsp;<br></li>
                                            <li>Requirements prioritization: how they are used&nbsp;<br></li>
                                            <li>Rich communication focus areas: importance and key techniques&nbsp;&nbsp;<br></li>
                                            <li>Frequent releases: significance, benefits and how to ‘fail fast’<br></li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                            <div class="card">
                                <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#collapse4">Project Performance</a> <span class="curi-num"> 4. </span> </div>
                                <div id="collapse4" class="card-body collapse " data-parent="#curriculum-accordion">
                                    <div class="topic-summary editor-content">
                                        <p><b>Learning objectives&nbsp;</b></p>
                                        <p>Learn to fix and flex the six aspects of a project in an agile context, how to use the Hexagon, the five targets that underpin the use of the hexagon, and more.&nbsp;</p>
                                        <p><br></p>
                                        <p><b>Topics</b></p>
                                        <ul>
                                            <li>The ‘Hexagon’ in relation to the six aspects of project performance&nbsp;</li>
                                            <li>The use of tolerances: what to ‘fix’ and what to ‘flex’&nbsp;&nbsp;<br></li>
                                            <li>The five targets that underpin the use of the hexagon&nbsp;<br></li>
                                            <li>The ‘fix and flex’ approach: why it’s good for the customer&nbsp;<br></li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                            <div class="card">
                                <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#collapse5">Tailoring PRINCE2 Agile</a> <span class="curi-num"> 5. </span> </div>
                                <div id="collapse5" class="card-body collapse " data-parent="#curriculum-accordion">
                                    <div class="topic-summary editor-content">
                                        <p><b>Learning objectives&nbsp;</b></p>
                                        <p>Gain in-depth expertise on how to apply PRINCE2 principles, themes, processes, and management products to a project in an agile context.</p>
                                        <p><b><br></b></p>
                                        <p><b>Topics&nbsp;</b></p>
                                        <ul>
                                            <li>The five PRINCE2 Agile behaviours: Transparency, Collaboration, Rich Communication, Self-Organization, Exploration&nbsp;</li>
                                            <li>Fundamental values and principles of agile&nbsp;&nbsp;</li>
                                            <li>Incorporating Agile in all seven PRINCE2 processes and themes as per project context&nbsp;<br></li>
                                            <li>The common roles of Scrum master and Product owner&nbsp;<br></li>
                                            <li>Options for team organization in a project: adjusting roles, including specialist roles&nbsp;<br></li>
                                            <li>The make-up of a typical delivery team&nbsp;<br></li>
                                            <li>Servant leadership: its use and importance&nbsp;<br></li>
                                            <li>Working Agreements: definition and significance&nbsp;<br></li>
                                            <li>Quality setting techniques: ‘definition of done’ and the use of acceptance criteria&nbsp;<br></li>
                                            <li>Quality testing, quality checking and management techniques&nbsp;&nbsp;<br></li>
                                            <li>Approaches to planning and typical planning techniques&nbsp;<br></li>
                                            <li>Approaches to risk and how agile concepts mitigate typical risks&nbsp;<br></li>
                                            <li>PRINCE2 and Agile: blending the two approaches&nbsp;&nbsp;<br></li>
                                            <li>Empowering self-organizing teams&nbsp;<br></li>
                                            <li>Importance of feedback loops&nbsp;<br></li>
                                            <li>Progress monitoring techniques: ‘work in progress’ boards, burn charts, information radiators&nbsp;<br></li>
                                            <li>Applying Agile techniques to PRINCE2 processes: Cynefin and more&nbsp;<br></li>
                                            <li>Flexing the ‘Direct a Project’ stage: benefits of collaborative working&nbsp;&nbsp;<br></li>
                                            <li>‘Manage by exception’: empowerment, deliverables, rich information flows and value of deliverables&nbsp;<br></li>
                                            <li>PRINCE2 ‘stages’, timeboxes and Scrum of scrums&nbsp;<br></li>
                                            <li>Output mechanisms in ‘Controlling a Stage’ and ‘Managing a Stage Boundary’&nbsp;<br></li>
                                            <li>Retrospectives: Uses and how to make them effective&nbsp;<br></li>
                                            <li>Product delivery approaches: Scrum, Kanban and others&nbsp;<br></li>
                                            <li>Work Packages, Product Descriptions, quality criteria and tolerances&nbsp;&nbsp;<br></li>
                                            <li>Behaviours, risk, and the frequency of releases&nbsp;<br></li>
                                            <li>Managing stage boundaries and the similarities between a stage and a release&nbsp;&nbsp;<br></li>
                                            <li>Assessing quantity, quality, and benefits of stage deliverables&nbsp;<br></li>
                                            <li>Effectively closing a project, including evaluation of the use of agile&nbsp;<br></li>
                                            <li>Tailoring PRINCE2 products: Work Packages, Highlight Reports and Checkpoint Reports&nbsp;<br></li>
                                            <li>Agile techniques that apply to PRINCE2 themes: requirements, defining value, user stories&nbsp;<br></li>
                                            <li>Use of contracts&nbsp;<br></li>
                                            <li>PRINCE2 Agile delivery roles&nbsp;<br></li>
                                            <li>Health Check: how to use it&nbsp;<br></li>
                                            <li>Tips for the PRINCE2 Agile project manager&nbsp;</li>
                                        </ul>
                                        <p>Refer the detailed course syllabus from AXELOS here: <a href="https://www.axelos.com/getmedia/ead0ca7c-2712-49ad-851a-752a9d6ce47a/PRINCE2-Agile-Practitioner-Candidate-Syllabus.aspx" target="_blank" rel="nofollow">PRINCE2 Agile Practitioner Certification Syllabus - AXELOS&nbsp;</a></p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </section>
    <section class="course-cert-faq" id="faq-1">
        <div class="container-fluid">
            <h2 class="section-heading">FAQs on the PRINCE2 Agile® Practitioner Course</h2>
            <div class="course-cert-faq-summary">
                <div class="row">
                    <div class="col-lg-8 col-md-8 col-sm-70">
                        <div class="cert-and-exam-section" id="prince2-agile-practitioner-course-1">
                            <h3>PRINCE2 Agile Practitioner Course</h3>
                            <div class="course-cert-faq-content accordion-cards custom-cards" id="faq-accordion-1">
                                <div class="card">
                                    <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#faq-heading-1-1">1. What can I expect to accomplish after completing the PRINCE2 Agile Practitioner course?</a> </div>
                                    <div id="faq-heading-1-1" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>The PRINCE2 Agile Practitioner course is the advanced PRINCE2 Agile course, thoughtfully designed to equip you with the skills to successfully deliver projects in an agile environment. By the end of the course, you will be equipped with all the tools and techniques to:</p>
                                            <ul>
                                                <li>Take charge of projects in diverse environments</li>
                                                <li>Achieve a higher likelihood of project success</li>
                                                <li>Improve efficiency at your workplace</li>
                                                <li>Be a successful motivator, collaborator, and leader</li>
                                                <li>Deliver successful projects on time and within budget </li>
                                                <li>Fine tune PRINCE2 to different project circumstances </li>
                                                <li>Guide a project from initiation to completion. </li>
                                                <li>Be a successful motivator, collaborator, and leader</li>
                                                <li>Drive results by applying PRINCE2 Agile in the right way</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-2">2. What practical skills can I expect to have after completing the PRINCE2 Agile Practitioner course?</a> </div>
                                    <div id="faq-heading-1-2" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>The PRINCE2 Agile Practitioner course is designed to help you apply the PRINCE2 Agile method in practice. By the end of the course, you have developed the skills to:</p>
                                            <ul>
                                                <li>Apply and tailor the PRINCE2 Agile to diverse projects&nbsp;&nbsp;</li>
                                                <li>Bring in project flexibility&nbsp;</li>
                                                <li>Provide business justification for the project&nbsp;&nbsp;</li>
                                                <li>Manage a project by breaking it into chunks&nbsp;&nbsp;</li>
                                                <li>Direct the project with key decisions</li>
                                                <li>Initiate project progress by understanding all aspects of strategies necessary for application and creation of products&nbsp;</li>
                                                <li>Facilitate self-managed and empowered teams that create space for people to thrive.</li>
                                                <li>Create an environment where different and better solutions can be discovered.</li>
                                                <li>Create an environment where new ideas are encouraged.</li>
                                                <li>Monitor the project and keep it under defined controls&nbsp;</li>
                                                <li>Communicate project progress to stakeholders&nbsp;</li>
                                                <li>Apply PRINCE2 Agile principles to close a project&nbsp;</li>
                                                <li>Check if the project has achieved all objectives&nbsp;</li>
                                                <li>Deliver product increments that meet agreed definitions of done early and in order of highest business value first.<br></li>
                                                <li>Deliver products that are fit for purpose to bring about desired outcomes.</li>
                                                <li>Deliver successful projects on time and within budget.</li>
                                                <li>Harness continuous learning, discovery and experimentation for real improvement.<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-3">3. How does a PRINCE2 Agile Practitioner certification help me?</a> </div>
                                    <div id="faq-heading-1-3" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>The PRINCE2 Agile Practitioner certification helps you:&nbsp;</p>
                                            <ul>
                                                <li>Validate your commitment to continued excellence and quality&nbsp;&nbsp;</li>
                                                <li>Demonstrate your proficiency of the PRINCE2 Agile framework&nbsp;&nbsp;<br></li>
                                                <li>Gain project management best practices&nbsp;&nbsp;<br></li>
                                                <li>Grow your career with confidence&nbsp;<br></li>
                                                <li>Work across diverse projects and challenging work environments&nbsp;&nbsp;<br></li>
                                                <li>Command higher salaries than your non-certified peers&nbsp;&nbsp;<br></li>
                                                <li>Improve your employment prospects&nbsp;<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-4">4. Is this PRINCE2 Agile Practitioner course only for software professionals?</a> </div>
                                    <div id="faq-heading-1-4" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>Not necessarily. The workshop is aimed at anyone directing or managing a PRINCE2 project who is using Agile or anyone involved with or impacted by a PRINCE2 project that is using Agile. With digitalization accelerating the pace of change, the demand for PRINCE2 Agile is fast growing across industries far beyond software.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-5">5. Who can attend the PRINCE2 Agile Practitioner course?</a> </div>
                                    <div id="faq-heading-1-5" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>The PRINCE2 Agile Practitioner course is beneficial for the following communities:&nbsp;</p>
                                            <ul>
                                                <li>PRINCE2 teams or individuals who wish to adopt Agile&nbsp;</li>
                                                <li>PRINCE2 teams or individuals encountering other teams using Agile in some form&nbsp;<br></li>
                                                <li>PRINCE2 teams or individuals practicing Agile in some form&nbsp;<br></li>
                                                <li>Teams or individuals who have some Agile experience and wish to adopt PRINCE2&nbsp;<br></li>
                                                <li>Teams or individuals who have adopted Agile and have reached high levels of maturity for both business as usual (BAU) and project work.&nbsp;</li>
                                            </ul>
                                            <p>The course is typically taken by:&nbsp;</p>
                                            <ul>
                                                <li>Agile Professionals&nbsp;</li>
                                                <li>Product Owners&nbsp;<br></li>
                                                <li>Scrum Masters&nbsp;<br></li>
                                                <li>Scrum Developers&nbsp;<br></li>
                                                <li>Project Managers&nbsp;&nbsp;<br></li>
                                                <li>Project Coordinators&nbsp;&nbsp;<br></li>
                                                <li>Project Analysts&nbsp;&nbsp;<br></li>
                                                <li>Project Leaders&nbsp;&nbsp;<br></li>
                                                <li>Product Managers&nbsp;&nbsp;<br></li>
                                                <li>Program Managers&nbsp;&nbsp;<br></li>
                                                <li>Project Sponsors&nbsp;&nbsp;<br></li>
                                                <li>Team Leaders&nbsp;<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-6">6. What are the prerequisites to attend the PRINCE2 Agile Practitioner course?</a> </div>
                                    <div id="faq-heading-1-6" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>To qualify for the PRINCE2 Agile Practitioner exam, delegates must have at least one of the following certifications:&nbsp;</p>
                                            <ul>
                                                <li>PRINCE2® Foundation or higher (applicable only to certificates obtained after 1 January 2009)&nbsp;</li>
                                                <li>PRINCE2 Agile® Foundation&nbsp;</li>
                                            </ul>
                                            <p>Certifications from Project Management Institute (PMI)®:&nbsp;</p>
                                            <ul>
                                                <li>Project Management Qualification (PMQ)®&nbsp;</li>
                                                <li>Certified Associate in Project Management (CAPM)®</li>
                                            </ul>
                                            <p>More details at www.pmi.org &nbsp;</p>
                                            <p>Certifications from International Project Management Association (IPMA):&nbsp;</p>
                                            <ul>
                                                <li>IPMA Level A® (Certified Projects Director)&nbsp;</li>
                                                <li>IPMA Level B® (Certified Senior Project Manager)&nbsp;<br></li>
                                                <li>IPMA Level C® (Certified Project Manager)&nbsp;<br></li>
                                                <li>IPMA Level D® (Certified Project Management Associate)&nbsp;</li>
                                            </ul>
                                            <p>More details at www.ipma.world &nbsp;</p>
                                            <p>Delegates who wish to have their prior certification recognized must be able to provide documentary proof to PeopleCert® — an AXELOS Examination Institute (EI) — that their qualification remains current.&nbsp;&nbsp;</p>
                                            <p>For further information on prerequisites, please refer <a href="#" target="_blank" rel="nofollow">AXELOS PRINCE2 Practitioner Certification</a>.&nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-7">7. What next after PRINCE2 Agile Practitioner certification?</a> </div>
                                    <div id="faq-heading-1-7" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>Once you have mastered PRINCE2 Agile® Practitioner, you can consider taking up:&nbsp;</p>
                                            <ul>
                                                <li>Project Management Professional (PMP)®&nbsp;</li>
                                                <li>Certified Associate in Project Management (CAPM)®&nbsp;<br></li>
                                                <li>ITIL® 4 Foundation<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-8">8. How can I maintain my PRINCE2 Agile Practitioner certification?</a> </div>
                                    <div id="faq-heading-1-8" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>The PRINCE2 Agile Practitioner certificate expires after three years. After that, you can either maintain the certification through your My PRINCE2 certification or retake the exam. To maintain your PRINCE2 qualification through My PRINCE2 certification:&nbsp;</p>
                                            <ul>
                                                <li>Within 3 months of successfully passing the exam, join the My PRINCE2 subscription. Every year, for the next 3 years, you will have to renew your subscription.&nbsp;</li>
                                                <li>Record 20 CPD points every year for extending the PRINCE2 digital badge.&nbsp;<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-9">9. What is Continuing Professional Development (CPD)?</a> </div>
                                    <div id="faq-heading-1-9" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>Continuing Professional Development (CPD) are credit points you can earn through professional training, experience, self-study, and community participation. AXELOS requires all PRINCE2 certified professionals to stay up to date with the latest project management knowledge. This can be done by acquiring CPD points.&nbsp;</p>
                                            <p>After you have successfully passed your PRINCE2 Agile exam, you can apply for the AXELOS membership. You will have to submit 20 CPDs every year for the next three years to maintain your membership. After 3 years, you will have 60 CPDs that will allow you to apply for the renewal of the certification.&nbsp;</p>
                                            <p>For further information about PDUs and CPDs, please reach us at support@knowledgehut.com.&nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-1-10">10. What is the My PRINCE2 Subscription?</a> </div>
                                    <div id="faq-heading-1-10" class="collapse " data-parent="#faq-accordion-1">
                                        <div class="card-body editor-content">
                                            <p>My PRINCE2 subscription is for all professionals in the field of project management who want to use practical help, easy-access support, and professional endorsements to advance their careers. With the My PRINCE2 subscription, you will also have access to the following:&nbsp;</p>
                                            <ul>
                                                <li>CPD toolset to keep your certificate up-to-date&nbsp;</li>
                                                <li>Discounts to some of AXELOS’ best practice publications&nbsp;<br></li>
                                                <li>Exclusive white papers&nbsp;<br></li>
                                                <li>PRINCE2. 6th edition templates<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="certification-process-2">
                            <h3>Certification Process</h3>
                            <div class="course-cert-faq-content accordion-cards custom-cards" id="faq-accordion-2">
                                <div class="card">
                                    <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#faq-heading-2-1">1. Who provides the PRINCE2 Practitioner certification?</a> </div>
                                    <div id="faq-heading-2-1" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>All PRINCE2 certifications are offered by AXELOS, the accrediting body for PRINCE2 Agile certification.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-2">2. Can I get certified without taking the course?</a> </div>
                                    <div id="faq-heading-2-2" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>You can self-study and take the examination directly through an AXELOS Examination Institute like PeopleCert®, without attending an accredited training course, for all the PRINCE2 certifications.&nbsp;</p>
                                            <p>However, undertaking a formalized training programme through an Accredited Training Organization (ATO) like KnowledgeHut highly increases your chances of being successful in the exam. Most importantly, beyond providing extensive exam preparation, the training will equip you with real-world skills and help you stand out among your peers.&nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-3">3. What is the process to become PRINCE2 Practitioner Certified?</a> </div>
                                    <div id="faq-heading-2-3" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>Here are the steps you should follow to get PRINCE2 Agile Practitioner certified: &nbsp;</p>
                                            <ol>
                                                <li>Fulfill the eligibility requirements. &nbsp;</li>
                                                <li>Decide whether to self-study or get trained by an Accredited Training Organization (ATO). When you enrol for KnowledgeHut's PRINCE2 Agile Practitioner training, you're in for an interactive and engaging learning experience that will help you acquire immediately applicable project management skills.&nbsp;<br></li>
                                                <li>Complete the 16-hour training with KnowledgeHut.&nbsp;<br></li>
                                                <li>Take advantage of KnowledgeHut's comprehensive exam support and hands-on training with discussions on real-world scenarios to gain the skills to apply PRINCE2 Agile in practice.&nbsp;<br></li>
                                                <li>If you have decided to self-study, schedule the exam through PeopleCert®. If you have enrolled with KnowledgeHut, we will schedule the exam on a date suitable for you. You can take the test online via PeopleCert Online Proctoring or at a Training Organization convenient for you. All you need is a PC or Mac and an internet connection. If you're taking the exam at a training organization near you, you will need to carry with you: (1) a print-out of the exam schedule from PeopleCert; (2) Proof of identity like passport, Driving license.&nbsp;<br></li>
                                                <li>You'll get to see your preliminary result on your computer screen instantly on completing your test. Your official results/e-certificate will be issued by PeopleCert within 5 business days. You'll then be able to see your result and download your certificate.&nbsp;<br></li>
                                                <li>Download your certificate from your PeopleCert profile after two business days of completing the exam. You're now a PRINCE2 Agile Practitioner certified project manager, ready to drive results for your organization!&nbsp;</li>
                                            </ol>
                                            <p>On passing the exam, AXELOS will send you an email regarding the My AXELOS membership and how you can activate it. Complete the yearly requirement of 20 CPDs to maintain your digital badge.&nbsp;</p>
                                            <p>The PRINCE2 Agile Practitioner certificate expires after 3 years. Renew your certification by taking the Practitioner exam again or by maintaining the CPD requirements.&nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-4">4. How long does it take to get PRINCE2 Practitioner certified?</a> </div>
                                    <div id="faq-heading-2-4" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>You will need to attend 16-hours of PRINCE2 Agile Practitioner training from an ATO of AXELOS and PeopleCert®, following which you will be required to take an exam to demonstrate your advanced knowledge of PRINCE2 Agile to get certified. &nbsp;&nbsp;</p>
                                            <p>The result of your test is issued within 5 business days from the date of your exam. If you pass the PRINCE2 Agile® Practitioner exam with the required score, you will also receive an e-certificate along with official results. Both the official results and the e-certificate will be uploaded on your PeopleCert® Account.</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-5">5. What is the My PRINCE2 Subscription?</a> </div>
                                    <div id="faq-heading-2-5" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>My PRINCE2 subscription is for all professionals in the field of project management who wants to use practical help, easy-access support, and professional endorsement to advance their careers. With the My PRINCE2 subscription, you will also have access to the following: &nbsp;&nbsp;</p>
                                            <ul>
                                                <li>CPD toolset to keep your certificate up-to-date &nbsp;&nbsp;</li>
                                                <li>Discounts to some of the AXELOS best practice publications &nbsp;&nbsp;<br></li>
                                                <li>Exclusive white papers &nbsp;&nbsp;<br></li>
                                                <li>PRINCE2. 6th edition templates &nbsp;&nbsp;<br></li>
                                                <li>PRINCE2. 6th edition and PRINCE2® Agile official online guidance &nbsp;<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-6">6. Is My PRINCE2® a paid subscription or is it free?</a> </div>
                                    <div id="faq-heading-2-6" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>PRINCE2® is a subscription model that can be tailor-made to meet the requirements of any project regardless of type and scale.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-7">7. What does My PRINCE2® subscription cost?</a> </div>
                                    <div id="faq-heading-2-7" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>A My PRINCE2® subscription will cost about £50 +VAT. If you subscribe for another year, the cost of the second subscription will be £30 (+VAT) and for a third subscription, the price will be £20 (+VAT) per annum. </p>
                                            <p>Once you reach the end of your subscription after 12 months, you will receive a reminder for subscription renewal before the expiry date. Failure to renew your subscription will lead to the removal of access from the latest publications, digital badges, CPD activities, and best practices available as a part of the product subscription. If you renew your subscription after the expiry date has passed and your subscription has lapsed, just log back in and pay the new subscription fee.</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-8">8. Is the PRINCE2 Agile® manual included in the course fee?</a> </div>
                                    <div id="faq-heading-2-8" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>No, the PRINCE2 Agile® Manual is not included in the course fee. You may purchase it here.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-9">9. What is the membership cost for AXELOS?</a> </div>
                                    <div id="faq-heading-2-9" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>The membership cost for AXELOS is £59 per year. VAT charges are extra as applicable.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-10">10. Do you provide a course completion certificate?</a> </div>
                                    <div id="faq-heading-2-10" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>Yes, you will receive a course completion certificate from KnowledgeHut on successfully completing the course.&nbsp;&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-11">11. Will my certificate say ‘Virtual’ if I take the certification online?</a> </div>
                                    <div id="faq-heading-2-11" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>No, your certificate will not mention that the course was held online. It will look the same as the in-person certificates. <br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-12">12. Why should I renew my PRINCE2 Agile Practitioner certification? </a> </div>
                                    <div id="faq-heading-2-12" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>Renewing your certification enables you to demonstrate your commitment to continuing professional development. It also demonstrates the value of your knowledge of PRINCE2 Agile to employers, peers and colleagues. Here are a few reasons why PRINCE2 qualifications are worth renewing:&nbsp;</p>
                                            <ul>
                                                <li>You will stay registered &nbsp;</li>
                                                <li>You can refresh your skills&nbsp;<br></li>
                                                <li>It opens doors to newer opportunities&nbsp;<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-2-13">13. How should I renew my certification?</a> </div>
                                    <div id="faq-heading-2-13" class="collapse " data-parent="#faq-accordion-2">
                                        <div class="card-body editor-content">
                                            <p>The PRINCE2 Agile Practitioner Certification exam is valid for 3 years. After that, you can take the re-registration exam, which has the same difficulty level as the Practitioner certification exam.&nbsp;</p>
                                            <p>You can also renew your credential by maintaining the My PRINCE2 Digital Badge. The cost of membership is £50 + VAT every year. After activating your membership, you must earn 20 CPDs every year to maintain the certification.&nbsp;</p>
                                            <p>For more details on the renewal process, refer to <a href="https://www.axelos.com/certifications/PRINCE2/maintaining-PRINCE2-practitioner-certification" target="_blank" rel="nofollow">https://www.axelos.com/certifications/PRINCE2/maintaining-PRINCE2-practitioner-certification&nbsp;</a></p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="prince2-agile-practitioner-exam-3">
                            <h3>PRINCE2 Agile Practitioner Exam</h3>
                            <div class="course-cert-faq-content accordion-cards custom-cards" id="faq-accordion-3">
                                <div class="card">
                                    <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#faq-heading-3-1">1. What is the PRINCE2 Agile Practitioner exam pattern and passing score?</a> </div>
                                    <div id="faq-heading-3-1" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <ul>
                                                <li>Duration - 150 minutes (2.5 hrs)&nbsp;</li>
                                                <li>Questions – 50 Objective type questions&nbsp;<br></li>
                                                <li>Pass mark – 30 out of 50 available, or 60%&nbsp;<br></li>
                                                <li>Use of textbook - Yes (only the official PRINCE2 Agile® manual permitted)&nbsp;<br></li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-2">2. Who conducts the exam?</a> </div>
                                    <div id="faq-heading-3-2" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>The exam is conducted through PeopleCert®. KnowledgeHut is an ATO of PeopleCert®.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-3">3. Can I take the PRINCE2 Agile Practitioner exam online?</a> </div>
                                    <div id="faq-heading-3-3" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>Yes, you can take the PRINCE2 Agile Practitioner exam online through PeopleCert®. You can schedule the exam in advance, at a time and date that suits you. Your exam will be invigilated by a proctor. Make sure that you meet the required <a href="https://www.peoplecert.org/-/media/Resources/Documents/PeopleCert/PASSPORT-Releases/ECSWI268ver020-Online-Proctored-Exams-Candidate-GuidelinesWindows.pdf" target="_blank" rel="nofollow">technical requirements</a> to continue with the exam without any issues. &nbsp;<span data-contrast="auto" class="TextRun SCXW196169731 BCX0" xml:lang="EN-IN" lang="EN-IN" style="margin:0px;padding:0px;user-select:text;-webkit-user-drag:none;-webkit-tap-highlight-color:transparent;color:#000;font-size:10.5pt;font-family:Arial,Arial_EmbeddedFont,Arial_MSFontService,sans-serif;line-height:16px;font-variant-ligatures:none !important;"> </span><span class="EOP SCXW196169731 BCX0" data-ccp-props="{&quot;201341983&quot;:2,&quot;335559739&quot;:160,&quot;335559740&quot;:330}" style="margin:0px;padding:0px;user-select:text;-webkit-user-drag:none;-webkit-tap-highlight-color:transparent;color:#000;font-size:10.5pt;line-height:16px;font-family:Arial,Arial_EmbeddedFont,Arial_MSFontService,sans-serif;">&nbsp;</span></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-4">4. Do you provide assistance for the PRINCE2 Agile Practitioner exam application process?</a> </div>
                                    <div id="faq-heading-3-4" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>Yes. You can contact us either by phone or chat if you need help with completing the application form. You can also email us on support@knowledgehut.co for any course-related queries.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-5">5. Will you give me the exam voucher and exam code for the PRINCE2 Agile® exam?</a> </div>
                                    <div id="faq-heading-3-5" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>Yes! Once you have completed the workshop, send us an email request for issue of exam voucher and code.&nbsp; Our exam team will email details of your exam code and instructions on how to book through PeopleCert®.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-6">6. If I fail, can I apply for re-evaluation?</a> </div>
                                    <div id="faq-heading-3-6" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>There is no re-evaluation for the PRINCE2 Agile Practitioner exam. However, if you fail you can re-attempt the exam. &nbsp;&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-7">7. Can I retake the PRINCE2 Agile Practitioner certification test if I fail? How soon?</a> </div>
                                    <div id="faq-heading-3-7" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>In case you have failed the PRINCE2 Agile® Foundation certification exam, you can retake the exam at a cost, which will depend on the country you will be taking the exam from. Taxes may or may not be applicable. Please contact your Workshop Manager for more information. The retake can be taken anytime, after your first attempt. &nbsp;</p>
                                            <p>If you wish to save on the Retake Exam Fee, you can sign up for PeopleCert’s 'TAKE2'. For this, you will be required to pay a small amount on top of your course fee, and then later, if you do not clear the exam on the first attempt, your second attempt is completely free of cost. &nbsp;</p>
                                            <p>More details can be found at <a href="https://www.peoplecert.org/Take2" target="_blank" rel="nofollow">PeopleCert</a>.&nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-8">8. Can I retake the PRINCE2 Agile Practitioner exam if I scored poorly? How soon?</a> </div>
                                    <div id="faq-heading-3-8" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>If you have already taken the exam and wish to retake to score better then you will have to repurchase the exam.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-9">9. How soon will I know the result of my exam?</a> </div>
                                    <div id="faq-heading-3-9" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p> After you have submitted the test, you will get your result within 2 business days. The entire process can take around 5 days. If you have taken the exam through PearsonVUE, PeopleCert will send a confirmation email to you within 7 days with a link to the e-certificate. Once you activate your PeopleCert account, you will be able to manage the certificate and buy the hard copy.&nbsp;</p>
                                            <p>You can read more about this here:&nbsp; <a href="https://www.peoplecert.org/help-and-support/FAQ#1FE000DE870C4762A29BBD7493749A90" target="_blank" rel="nofollow">PeopleCert</a>&nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-3-10">10. How many attempts do I have to pass the PRINCE2 Agile Practitioner exam? </a> </div>
                                    <div id="faq-heading-3-10" class="collapse " data-parent="#faq-accordion-3">
                                        <div class="card-body editor-content">
                                            <p>You can give the exam as many times as you want as long as you pay for it each time.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="workshop-experience-4">
                            <h3>Workshop Experience</h3>
                            <div class="course-cert-faq-content accordion-cards custom-cards" id="faq-accordion-4">
                                <div class="card">
                                    <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#faq-heading-4-1">1. What are the modes of training offered for this course?</a> </div>
                                    <div id="faq-heading-4-1" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>The PRINCE2 Agile Practitioner workshop at KnowledgeHut is delivered through immersive learning experience platform, via live and interactive instructor-led training sessions.&nbsp;</p>
                                            <p>Listen, learn, ask questions, and get all your doubts clarified from your instructor, who is an experienced practitioner.</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-2">2. How different is the PRINCE2 Agile Practitioner online training from the conventional in-person training?</a> </div>
                                    <div id="faq-heading-4-2" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>The conventional in-person PRINCE2 Agile Practitioner training from AXELOS will be delivered as a 16 hour or 2-day training course. The online course is divided into several classes of shorter hours, unlike the in-person class that has 2 classes, each 7 to 8 hours long. The size of the class is capped at 30 so that students gain a better learning experience. The instructor uses tools like a webcam for interacting with the participants and participants will also be able to virtually collaborate with one another.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-3">3. Who are the instructors?</a> </div>
                                    <div id="faq-heading-4-3" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>Our PRINCE2 Agile® trainers are: &nbsp;</p>
                                            <ul>
                                                <li>Experienced project management professionals who have worked in an Agile environment&nbsp;</li>
                                                <li>Experts with immense experience in leading, applying, coaching, and teaching about project management and Agile&nbsp;</li>
                                            </ul>
                                            <p>Our dedicated team of coaches deliver training on par with the standard of excellence as set out by AXELOS. Every candidate receives the same high-quality content irrespective of the trainer and the location. They help you further develop the competencies and skills you need to make a difference in your organization. &nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-4">4. How are the workshops structured?</a> </div>
                                    <div id="faq-heading-4-4" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>Currently, our PRINCE2 Agile® courses are delivered through live interactive virtual classrooms, and can be structured over two days or more. Our PRINCE2 Agile Practitioner course focuses on engaging interaction. Most class time is dedicated to fun exercises, lively discussions, and team collaboration, all facilitated by the trainer who is an experienced project manager well versed with PRINCE2 and Agile. The focus is on practical solutions to real-world challenges drawn from decades of experience as project managers in dynamic environments.&nbsp;&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-5">5. What are the software and system requirements?</a> </div>
                                    <div id="faq-heading-4-5" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p><b>Software Requirements &nbsp;</b></p>
                                            <ul>
                                                <li>Internet browser &nbsp;</li>
                                                <li>MS Word or Notepad&nbsp;&nbsp;</li>
                                            </ul>
                                            <p><b>System Requirements</b></p>
                                            <ul>
                                                <li>Windows or equivalent environment with Internet browser and high-speed Internet connectivity &nbsp;</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-6">6. Are course materials and workshop instructions provided in advance?</a> </div>
                                    <div id="faq-heading-4-6" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>Yes, your course material will be provided in advance. You will receive an email with a link to set your password a few days in advance of the scheduled course. Once you log in to PRISM, you will have access to the study plan and all the course material.&nbsp;&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-7">7. What course material will I receive?</a> </div>
                                    <div id="faq-heading-4-7" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>The course material comprises of the course schedule or study plan, workbooks and all relevant assignments, assessments, or case studies.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-8">8. Can I record the session?</a> </div>
                                    <div id="faq-heading-4-8" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>The sessions would be auto recorded on PRISM, subject to permission by Axelos and our trainer. Based on the permissions, you would have lifetime access to the video recordings of the sessions as well.<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-9">9. Can I use my phone or tab for the training?</a> </div>
                                    <div id="faq-heading-4-9" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>No, you will not yet be able to join the training through phone or tab. Please be prepared to join the training on your laptop or desktop.&nbsp;&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-10">10. What if I lose internet connection during the training?</a> </div>
                                    <div id="faq-heading-4-10" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>If you get disconnected during the training, you will have the option to re-join within about half an hour subject to accreditation body guidelines and the instructor’s preference.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-11">11. Where will the PRINCE2 Agile Practitioner workshop be held?</a> </div>
                                    <div id="faq-heading-4-11" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>Our workshops are currently held online and anyone with a stable internet from anywhere across the world can benefit from this to get PRINCE2 certified. You can check out the schedules here: PRINCE2 agile Practitioner Certification Course <a href="#" target="_blank" rel="nofollow">Schedules</a></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-12">12. How do I join the class?</a> </div>
                                    <div id="faq-heading-4-12" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>You will receive a registration link from PRISM to your e-mail id. You will have to set your password, log in to our Immersive Learning Experience platform and start your learning journey. <br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-13">13. What if I miss a class?</a> </div>
                                    <div id="faq-heading-4-13" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>If you miss a class, you can access the class recordings from PRISM at any time. At the beginning of every session, there will also be a 10-12 minute recapitulation of the previous class. &nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-14">14. Is this a live training, or will I watch pre-recorded videos?</a> </div>
                                    <div id="faq-heading-4-14" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>This is a live instructor led training where you will be coached by PRINCE2 experts. &nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-15">15. What platform do you use for video conferencing?</a> </div>
                                    <div id="faq-heading-4-15" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>We currently use the Zoom platform for video conferencing and will soon be adding more integrations with Webex and Microsoft Teams. However, all the sessions and the recordings will be available right from within our learning platform. Learners will not need to wait for any notifications or links or install any additional software. &nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-16">16. Will I have other participants in the class?</a> </div>
                                    <div id="faq-heading-4-16" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>Yes, there are other participants who actively participate in the class remotely. They can attend online training from office, home, or any other suitable place. &nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-17">17. How does the 24/7 support work?</a> </div>
                                    <div id="faq-heading-4-17" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>In case of any queries, our support team is available to you 24/7 via the Help and Support section on PRISM. You can also reach out to your workshop manager on your workshop group messenger.<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-4-18">18. I have some more doubts. How can I get them cleared?</a> </div>
                                    <div id="faq-heading-4-18" class="collapse " data-parent="#faq-accordion-4">
                                        <div class="card-body editor-content">
                                            <p>Should you have any more questions, please email us on <a href="http://support@knowledgehut.com" target="_blank">support@knowledgehut.com</a> and we will be happy to get back to you. &nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="finance-related-queries-5">
                            <h3>Finance-Related Queries</h3>
                            <div class="course-cert-faq-content accordion-cards custom-cards" id="faq-accordion-5">
                                <div class="card">
                                    <div class="card-header"> <a class="card-link collapsed" data-toggle="collapse" href="#faq-heading-5-1">1. Can I cancel my enrolment? Do I get a refund?</a> </div>
                                    <div id="faq-heading-5-1" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>With our 100% Satisfaction Guarantee policy, you are assured of the highest standards of quality. At KnowledgeHut, we strive to ensure that your learning experience with us is beyond reproach. However, if for any reason your expectations are not met, we will refund the course fee in accordance with our <a href="#" target="_blank">100% Satisfaction Guarantee policy</a>.&nbsp;</p>
                                            <p><b>Note*:</b>&nbsp; In case of refunds, it will be credited back to your account within 10-15 business days of the refund request.</p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-5-2">2. What is the certification exam fee?</a> </div>
                                    <div id="faq-heading-5-2" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>The certification fee for the PRINCE2 Agile Practitioner exam is not charged separately. Once you enrol for the exam with KnowledgeHut, the exam fee is included in the course fee.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-5-3">3. Is the certification fee inclusive of the course fee?</a> </div>
                                    <div id="faq-heading-5-3" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>Yes, the exam fee is included in the course fee. <br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-5-4">4. How much do I have to pay for my PRINCE2 Agile Practitioner certification renewal?</a> </div>
                                    <div id="faq-heading-5-4" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>You can renew your credential by maintaining the My PRINCE2 Digital Badge. The cost of membership is £50 + VAT every year. After activating your membership, you must earn 20 CPDs every year to maintain the certification.&nbsp;</p>
                                            <p>For more details on the renewal process, refer to <a href="https://www.axelos.com/certifications/PRINCE2/maintaining-PRINCE2-practitioner-certification" target="_blank" rel="nofollow">https://www.axelos.com/certifications/PRINCE2/maintaining-PRINCE2-practitioner-certification</a></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-5-5">5. Can I switch my start date?</a> </div>
                                    <div id="faq-heading-5-5" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>Yes, you can switch your start date with prior notice of at least 24 hrs and subject to availability in the desired batch.&nbsp;<br></p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-5-6">6. Are there any scholarships available?</a> </div>
                                    <div id="faq-heading-5-6" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>Yes, we have scholarships available for students and veterans with grants that can vary up to 50% of the course fees. </p>
                                            <p>To avail scholarships, please get in touch with us at support@knowledgehut.com. The team shall send across the forms and instructions to you. Based upon the responses and answers that we receive, our panel of experts take a decision on the Grant. The entire process could take about 7 to 15 days. </p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-5-7">7. Are there any group discounts?</a> </div>
                                    <div id="faq-heading-5-7" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>Yes, group discounts are available and apply to groups as small as three (3) participants. The more participants that attend a training course, the greater the discount. By registering in groups, you can typically save up 20% to 30% on the course fee. For more details, please check out <a href="#" target="_blank" rel="nofollow">upcoming schedules</a>. </p>
                                        </div>
                                    </div>
                                </div>
                                <div class="card">
                                    <div class="card-header"> <a class="card-link  collapsed" data-toggle="collapse" href="#faq-heading-5-8">8. Can I pay the course fees in instalments?</a> </div>
                                    <div id="faq-heading-5-8" class="collapse " data-parent="#faq-accordion-5">
                                        <div class="card-body editor-content">
                                            <p>Yes, instalment options are available for payment of course fees. To avail the instalment option, please get in touch with us at <a href="http://support@knowledgehut.com" target="_blank">support@knowledgehut.com</a>. The team will explain how the instalments work and provide timelines for your case. &nbsp;</p>
                                            <p>Usually, the number of instalments varies from 2 to 3, but the full amount must be paid before you complete the course.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
